import React, { useState } from "react";
import "./Navbar.css";

function Navbar({ setIsLoggedIn }) {
  const [showLogout, setShowLogout] = useState(false);

  const handleLogoutClick = () => {
    // Logic for logging out can be placed here
    setIsLoggedIn(false); // set user to be logged out
    setShowLogout(false); // hide the logout button
  };

  return (
    <nav>
      <h2>Resource Management</h2>
      {/* Other Navbar items */}
      <div className="user-section">
        <i onClick={() => setShowLogout(!showLogout)}>user</i>
        {showLogout && <button onClick={handleLogoutClick}>Log Out</button>}
      </div>
    </nav>
  );
}

export default Navbar;
